import React from "react";
import SearchBar from '../SearchBar/SearchBar'
import { Link } from "react-router-dom";

const Nav = ({onSearch}) => {
    return (
        <div style={{
                width: '950%',
                display: 'flex',
                alignItems:'center'
            }}>
            
            <SearchBar onSearch={onSearch} />

            <Link to="/home">
                <button style={{display: "flex", position: "relative"}}>Home</button>
            </Link> 
            
            <Link to="about">
                <button style={{display: "flex", position: "relative"}}>About</button>
            </Link>
        </div>
    )
}

export default Nav
